import React from "react";
import { connect } from "react-redux";
import User from '../components/User';

export function Home({users}){
    return(
        <div>
        <div className="d-flex justify-content-center">
            <h4>DOCENTES</h4>
            <input placeholder='Buscar por Nombre' className="mx-10"></input>
            <div className="align-self-center">X</div>
        </div>
            {
                users && users.map(u => <div>
                    <User key={u.id} apellido={u.apellido} nombres={u.nombres}
                    docnro={u.docnro} email={u.email} domicilio={u.domicilio}
                    telefono={u.telefono} fechasalida={u.fechasalida} iddocente={u.iddocente}/>
                </div>)
            }
        </div>
    )
}

function mapStateToProps(state){
    return{
        users: state.users
    }
}

export default connect(mapStateToProps,null)(Home)
